package menu.domain;import java.util.Objects;public class Category {    private final String name;    public Category(String name) {        this.name = name;    }    @Override    public boolean equals(Object object) {        Category category = (Category) object;        if (category.name.equals(this.name)) {            return true;        }        return false;    }    @Override    public int hashCode(){        return Objects.hash(name);    }}